import React from "react"


export default function Register ({values, update}) {
    console.log(values)

    const onChange = (event) => {
        const {name, value, type, checked} = event.target
        type === "checkbox" ? update(name, checked) : update(name, value)
    }

    return (
       <form>
           <label htmlFor="name">
               Username: 
               <input
                    type= "text"
                    name="name"
                    id="name"
                    placeholder="Enter Your UserName"
                    // value={}
                    // onChange={}
                />
           </label>

           <label htmlFor="email">
           Email:
               <input
                type="email"
                name="email"
                id="email"
                placeholder="Enter Your Email"
                // value={}
                // onChange={}
                />
           </label>

           <label htmlFor="password">
           Password:
               <input
                    type="password"
                    name="password"
                    id="password"
                    placeholder="Enter Your Password"
                    // value={}
                    // onChange={}

                 />
           </label>
           <label htmlFor="conPassword">
           Confirm Your Password:
                <input
                    type="password"
                    name="conPassword"
                    id="conPassword"
                    placeholder="Confirm Your Password"
                    // value={}
                    // onChange={}

                 />
           </label>

           <label htmlFor="terms">
           Do you agree to the terms and conditions?
               <input
                    type="checkbox"
                    name="terms"
                    id="terms"
                    // checked={}
                    // onChange={}

                />
           </label>
           <button>Sing Up</button>
       </form>
    )
}
